package com.heiya123.music.entity.QQ;import java.io.Serializable;import java.util.List;public class QQMusicUrl implements Serializable{	private static final long serialVersionUID = 1257660681L;	private long code;	private List<String> sip;	private List<String> thirdip;	private String testfile2g;	private String key;	private String testfilewifi;	public long getCode() {		return this.code;	}	public void setCode(long code) {		this.code = code;	}	public List<String> getSip() {		return this.sip;	}	public void setSip(List<String> sip) {		this.sip = sip;	}	public List<String> getThirdip() {		return this.thirdip;	}	public void setThirdip(List<String> thirdip) {		this.thirdip = thirdip;	}	public String getTestfile2g() {		return this.testfile2g;	}	public void setTestfile2g(String testfile2g) {		this.testfile2g = testfile2g;	}	public String getKey() {		return this.key;	}	public void setKey(String key) {		this.key = key;	}	public String getTestfilewifi() {		return this.testfilewifi;	}	public void setTestfilewifi(String testfilewifi) {		this.testfilewifi = testfilewifi;	}}